        then: [t: "fois"]                       	# 	(en: 'times', google translation)
        else_test:
            if: $ClearSpeak_MultSymbolX = 'By'
            then: [t: "par"]                    	# 	(en: 'by', google translation)
            else: [t: "multiplié par"]          	# 	(en: 'cross')
